actionConfiguration.body:
() => {
  var select_barcode = Qry_select_Sample.data;
  var sql = "INSERT INTO Bartender_Queue (Barcode, Created, Created_By, Template_Type, Status, ProjectID,	Country_of_Origin, DescriptionID,	Processor_Speed, Processor_Speed_Unit, Brand_Name, Storage_1, Storage_1_Unit,	Storage_2, Storage_2_Unit, Dimm_1, Dimm_1_Unit,	Dimm_2, Dimm_2_Unit, ODD, AC_DC_Adapter, Sample_Build, SKU,	Structure_Type,	Unit_Price_USD, Model_Name,	Part_Number, Remarks,	Serial_Number, Waybill,	Waybill_Provider,	Processor_SKU)\n";
  sql += "VALUES\n";
  for (let i = 0; i < select_barcode.length; i++) {
    sql += "(";
    sql += "'" + select_barcode[i].Barcode + "', ";
    sql += "'" + moment().utc(0).format("YYYY-MM-DD HH:mm:ss") + "', ";
    sql += "'" + appsmith.user.email + "', ";
    sql += "'" + 'OEM System' + "', ";
    sql += "'" + 'Ready for print' + "', ";
    sql += "'" + (select_barcode[i].ProjectID === null ? '' : select_barcode[i].ProjectID) + "', ";
    sql += "'" + (select_barcode[i].Country_of_Origin === null ? '' : select_barcode[i].Country_of_Origin) + "', ";
    sql += "'" + (select_barcode[i].DescriptionID === null ? '' : select_barcode[i].DescriptionID) + "', ";
    sql += "'" + (select_barcode[i].Processor_Speed === null ? '' : select_barcode[i].Processor_Speed) + "', ";
    sql += "'" + (select_barcode[i].Processor_Speed_Unit === null ? '' : select_barcode[i].Processor_Speed_Unit) + "', ";
    sql += "'" + (select_barcode[i].Brand_Name === null ? '' : select_barcode[i].Brand_Name) + "', ";
    sql += "'" + (select_barcode[i].Storage_1 === null ? '' : select_barcode[i].Storage_1) + "', ";
    sql += "'" + (select_barcode[i].Storage_1_Unit === null ? '' : select_barcode[i].Storage_1_Unit) + "', ";
    sql += "'" + (select_barcode[i].Storage_2 === null ? '' : select_barcode[i].Storage_2) + "', ";
    sql += "'" + (select_barcode[i].Storage_2_Unit === null ? '' : select_barcode[i].Storage_2_Unit) + "', ";
    sql += "'" + (select_barcode[i].Dimm_1 === null ? '' : select_barcode[i].Dimm_1) + "', ";
    sql += "'" + (select_barcode[i].Dimm_1_Unit === null ? '' : select_barcode[i].Dimm_1_Unit) + "', ";
    sql += "'" + (select_barcode[i].Dimm_2 === null ? '' : select_barcode[i].Dimm_2) + "', ";
    sql += "'" + (select_barcode[i].Dimm_2_Unit === null ? '' : select_barcode[i].Dimm_2_Unit) + "', ";
    sql += "'" + (select_barcode[i].ODD === null ? '' : select_barcode[i].ODD) + "', ";
    sql += "'" + (select_barcode[i].AC_DC_Adapter === null ? '' : select_barcode[i].AC_DC_Adapter) + "', ";
    sql += "'" + (select_barcode[i].Sample_Build === null ? '' : select_barcode[i].Sample_Build) + "', ";
    sql += "'" + (select_barcode[i].SKU === null ? '' : select_barcode[i].SKU) + "', ";
    sql += "'" + (select_barcode[i].Structure_Type === null ? '' : select_barcode[i].Structure_Type) + "', ";
    sql += "'" + (select_barcode[i].Unit_Price_USD === null ? '' : select_barcode[i].Unit_Price_USD) + "', ";
    sql += "'" + (select_barcode[i].Model_Name === null ? '' : select_barcode[i].Model_Name) + "', ";
    sql += "'" + (select_barcode[i].Part_Number === null ? '' : select_barcode[i].Part_Number) + "', ";
    sql += "'" + (select_barcode[i].Remarks === null ? '' : select_barcode[i].Remarks) + "', ";
    sql += "'" + (select_barcode[i].Serial_Number === null ? '' : select_barcode[i].Serial_Number) + "', ";
    sql += "'" + (select_barcode[i].Waybill === null ? '' : select_barcode[i].Waybill) + "', ";
    sql += "'" + (select_barcode[i].Waybill_Provider === null ? '' : select_barcode[i].Waybill_Provider) + "', ";
    sql += "'" + (select_barcode[i].Processor_SKU === null ? '' : select_barcode[i].Processor_SKU) + "'),\n";
  }
  sql = sql.slice(0, -2);
  return sql;
}

